/* CREATE TABLE `products` (
	  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'УИД товара',
	  `product_types_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор типа товара',
	  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
	  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
	  `format` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Размер/Формат(25.5 x 25.5 x 6.3)',
	  `weight` int(11) NOT NULL COMMENT 'Вес, г',
	  `anotation` varchar(1024) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Анотация',
	  `available` int(11) NOT NULL COMMENT 'Доступно (общее количество товара)',
	  `price` decimal(11,2) NOT NULL COMMENT 'Цена',
	  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
	  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
	  PRIMARY KEY (`id`),
	  KEY `products_product_types_id_fk` (`product_types_id`),
	  CONSTRAINT `products_product_types_id_fk` FOREIGN KEY (`product_types_id`) REFERENCES `product_types` (`id`)
) COMMENT='Товары (Товарная позиция)';*/

DESCRIBE products;

-- 
-- Обновить инфорамацмю в таблице Товаров, после вставки данных
-- 
-- Обновляем цены товаров
-- 
UPDATE products SET price = FLOOR(100 + (RAND() * 1000)) WHERE price > 1000;
UPDATE products SET price = FLOOR(100 + (RAND() * 100)) WHERE price < 100;
-- 
-- Обновляем типы товаров
-- 
UPDATE products SET product_types_id = FLOOR(1 + RAND() * 66); -- FLOOR - отбросить дробную часть
UPDATE products SET product_types_id = FLOOR(1 + RAND() * 66); -- FLOOR - отбросить дробную часть
UPDATE products SET product_types_id = product_types_id + 5 WHERE product_types_id < 6; -- FLOOR - отбросить дробную часть
UPDATE products SET product_types_id = product_types_id + 2 WHERE product_types_id = 56 OR product_types_id = 27 OR product_types_id = 28; -- FLOOR - отбросить дробную часть
-- 
-- Размер/Формат(25.5 x 25.5 x 6.3)
UPDATE products SET format = CONCAT(CAST(FLOOR(50 + (RAND() * 50)) AS char), ' x ', CAST(FLOOR(30 + (RAND() * 50)) AS char), ' x ', FLOOR(1 + (RAND() * 10)));
-- 
-- Обновляем дату создания записи
-- 
UPDATE products SET created_at=DATE_FORMAT(created_at,'2020-%m-%d %T');
-- 
SELECT id, product_types_id, name, description, format, weight, anotation, available, price, created_at, updated_at FROM products;

